import React from 'react'
import {Table} from 'antd'
import {CloseOutlined,PlusCircleOutlined} from '@ant-design/icons'
import {PlusButton, Container, FilterContainer, SelectStyled, SelectContainer, returnEmojiString, GenIconButton, GenButton} from './DashboardPage.styled'
import {MichiganFootballGame, FilterOptions, Ticket} from '../../../model'

const COLUMNS = [
    {
        title: 'Game',
        key: 'game',
        dataIndex: 'game',
        render: (text, data) => returnEmojiString(data.game)
    },
    {
        title: 'Section',
        key: 'section',
        dataIndex: 'section'
    },
    {
        title: 'Price ($)',
        key: 'price',
        dataIndex: 'price'
    },
    {
        title: '',
        key: 'remove',
        dataIndex: 'ticketId',
        render: (text, data) => (
            <div style={{display: 'flex', justifyContent: 'flex-end'}}>
                <GenIconButton icon={<CloseOutlined style={{fontSize: 16}} />} onClick={() => {}}>
                    Remove
                </GenIconButton>
            </div>
          )
    }
];

const DATA: Ticket[] = [
    {
        game: MichiganFootballGame.Ball,
        price: 25,
        id: '12345',
        section: 24
    },
    {
        game: MichiganFootballGame.Arkansas,
        price: 25,
        id: '1234567',
        section: 25
    },

];

const SellSection: React.FC = () => {
    return (
        <Container>
            <FilterContainer style={{justifyContent: 'flex-end'}}>
                <GenButton style={{
                        fontFamily: 'Mark Pro', 
                        paddingBottom: 18,
                        paddingTop: 18,
                        paddingLeft: 35,
                        paddingRight: 35,
                        fontSize: 14
                    }} onClick={() => {}} icon={<PlusCircleOutlined style={{fontSize: 17}} />}>
                    Add Ticket
                </GenButton>
            </FilterContainer>
            <Table columns={COLUMNS} dataSource={DATA} pagination={{ position: ['bottomCenter'] }} />
        </Container>
    )
}

export default SellSection
